/* Disabled if marked as such on either the EI or the TE */
IF((PrePostShowEmailDisabled__c || TicketableEvent__r.PrePostShowEmailDisabled__c ), ("Disabled"),

  /* No Override */
  IF(((MinutesUntilInstanceDate__c > 0 && TicketableEvent__r.PreShowEmailMinutes__c == 0) || 
      (MinutesUntilInstanceDate__c  <= 0 && TicketableEvent__r.PostShowEmailMinutes__c == 0)), ("NoOverride"),

    /* PreShow if PreShowEmailTime is overridden and within the window */
    IF((MinutesUntilInstanceDate__c > 0 && 
        TicketableEvent__r.PreShowEmailMinutes__c > 0 && 
        MinutesUntilInstanceDate__c <= TicketableEvent__r.PreShowEmailMinutes__c), ("PreShow"),

      /* PostShow if PostShowEmailTime is overridden and within the window */
      IF(MinutesUntilInstanceDate__c  <= 0 && 
        TicketableEvent__r.PostShowEmailMinutes__c > 0 &&          
         ABS(MinutesUntilInstanceDate__c) >= (TicketableEvent__r.PostShowEmailMinutes__c) &&
         /* We stop sending 24 hours after the time we start sending: */
         ABS(MinutesUntilInstanceDate__c) < ((TicketableEvent__r.PostShowEmailMinutes__c) + 60 * 24), ("PostShow"),

       /* NULL if not in any override window */
       NULL
      )
    )
  )
)
